Now let's comb through the code and try to understand what we did we do exactly. #include <stdio.h> int main(){ printf("Hello, World!
"); return 0;
} #include <stdio.h> This line of code "includes" the stdio.h header file, its short for standard input output. It has a lot of functions that we can use to input and output stuff on the terminal. int main(){ ... } This is the main function. This is the first block of code that is executed when we run the program. The int placed there implies that the main function returns an integer. If you are confused by what a function is, don't worry functions will be discussed in detail in later chapters printf("Hello, World!
"); This is the line of code responsible for printing the text "Hello, World!" on the screen, the 
 prints a new line after the text. This function is defined in the stdio.h header file we just included on the first line. return 0; Remember the int in int main(){ ... } ? This line returns 0 because the main function has to return a integer. It also means that the program ended successfully without any errors.
